import React from "react";
import { Link } from "react-router-dom";

const User = ({ posts }) => {
  <div>
    {posts.map((user, key) => (
      <div key={key}>
        <Link
          className="dropdown-item"
          to={{
            pathname: `/update-user/${user._id}`,
          }}
        >
          <div className="text-center "> User </div>
        </Link>
      </div>
    ))}
  </div>;
};

function UserData() {
  return <div>{User}</div>;
}

export default UserData;
